ins = """



"""

things = ins.split('\n')

c = [[0,0,1,0,0],[0,2,3,4,0],[5,6,7,8,9],[0,'A','B','C',0],[0,0,'D',0,0]]
x = 1
y = 1

for i in things:
    for j in i:
        ci,cy = x,y
        if j == 'R':
            x += 1
        elif j == 'L':
            x -= 1
        elif j == 'U':
            y -= 1
        elif j == 'D':
            y += 1
        if x == 5:
            x = 4
        if y == 5:
            y = 4
        if x == -1:
            x = 0
        if y == -1:
            y = 0
        if c[y][x] == 0:
            x,y = ci,cy
    print(c[y][x])
